import React from 'react';
import service1 from '../../assets/images/service-1.png';
import service2 from '../../assets/images/service-2.png';
import service3 from '../../assets/images/service-3.png';
import SingleService from './SingleService';
const Services = () => {
    return (
        <section className='services my-10'>
            <div className="section-title my-5 text-center">
                <h6 className="title">OUR SERVICES</h6>
                <h3 className='font-light text-4xl my-5'>Services We Provide</h3>
            </div>
            <div className='px-6 grid grid-cols-3'>
                <SingleService img={service1}/>
                <SingleService img={service2}/>
                <SingleService img={service3}/>
            </div>
        </section>
    );
};

export default Services;
